Thank CPG Not ME!

WO WO WO...WO ...   did someone just said we dont need WEBRip of this cuz it has subs. WTF man.........i mean......

Anyways... good first ITA CAM had some usual CAM issues but nothing so big though, saw bunch of encodes out there of this movie but apparently none able to fixed that dark and grainy parts of it.  been busy with stuff so cant run for cinema so decided to run my quick encode. pick the source i found and did my thingy on it wanna to spend some more time on it but cant find time for it, those who have downloaded previous ones will see some better different and for rest of them there is sample to judge.  
Line from sandman was good to hear, cut the Universal logo from my video which seems like someone edited into the video, did it in order to sync audio perfectly,  everything went smooth.

as a side note i would like to thanks to jinx and all those who were involved in Antman line rls. thx folks i wanna to do that movie on our video so badly been looking for audio for a while and this is by far your best work in my honest opinion. 

Cheers fellas.  Sample included, do check it first,   Oh! unlike some other i will tell you clearly this source has some mins missing from start.

